// SPDX-License-Identifier: MIT
 pragma solidity 0.8.20;

    /* 
 contract that calculates the area of a triangle, rectangle and square. 
 the  contract should have separate functions for shape.
 Deploy the contract and submit contract address with your name, wallet address and contract address
 use hardhat or foundry to deploy
 */
 contract CalculateArea{

    function areaTriangle(uint256 length, uint256 breadth) public pure returns(uint256){
        //formula of triangle 
        // area = 1/2 * length * breadth 
        uint256 area = (length * breadth) / 2;
        return area;
    }

    function areaRectangle(uint256 length, uint256 breadth) public pure returns (uint256){
        //formula of rectangle 
        // area = length * breadth 
        uint256 area = length * breadth;
        return area;
    }

    function areaSquare(uint256 length) public pure returns(uint256){
        //formula of square 
        // area =Legnth**2 
        uint256 area = length**2;
        return area;
    }
 }

